import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import Badge from "react-bootstrap/Badge";
import Stack from "react-bootstrap/Stack";
import axios from "axios";
import React, { useEffect, useState ,useContext} from "react";
import { Appcontext } from "../../App";

function ReadbyPatientId() {
  const [mypatientqns, setMypatientqns] = useState([]);
  const { patientid } = useContext(Appcontext);

  useEffect(() => {
    const fn = async () => {
      try {
        const response = await axios.get(
          `http://localhost:5000/stackExchange/${patientid}`
        );
        setMypatientqns(response.data);
        console.log(mypatientqns)
      } catch (err) {
        console.log(err);
      }
    };

    fn();
  }, []);

  return (
    <>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          gap: "20px",
          border: "2px solid #000",
          margin: "20px",
          padding: "20px",
        }}
      >
        <Card style={{ borderRadius: "0" }}>
          <Card.Header
            as="h5"
            className="d-flex justify-content-between align-items-center"
            style={{ fontFamily: "sans-serif" }}
          >
            Featured
            <Button
              variant="secondary"
              type="submit"
              style={{ fontFamily: "sans-serif" }}
            >
              Edit
            </Button>
          </Card.Header>
          <Card.Body>
            <Card.Title style={{ fontFamily: "sans-serif" }}>
              Special title treatment
            </Card.Title>
            <Card.Text style={{ fontFamily: "sans-serif" }}>
              Apple Inc. is an American multinational technology company
              headquartered in Cupertino, California. Apple is the world's
              largest technology company by revenue, with US$394.3 billion in
              2022 revenue.[6] As of March 2023, Apple is the world's biggest
              company by market capitalization.[7] As of June 2022, Apple is the
              fourth-largest personal computer vendor by unit sales and the
              second-largest mobile phone manufacturer in the world. It is
              considered one of the Big Five American information technology
              companies, alongside Alphabet (parent company of Google), Amazon,
              Meta Platforms, and Microsoft.
              <Stack direction="horizontal" gap={2}>
                <Badge
                  bg="dark"
                  style={{ fontFamily: "sans-serif", borderRadius: "0px" }}
                >
                  secondary
                </Badge>
                <Badge
                  bg="dark"
                  style={{ fontFamily: "sans-serif", borderRadius: "0px" }}
                >
                  secondary
                </Badge>
                <Badge
                  bg="dark"
                  style={{ fontFamily: "sans-serif", borderRadius: "0px" }}
                >
                  secondary
                </Badge>
                <Badge
                  bg="dark"
                  style={{ fontFamily: "sans-serif", borderRadius: "0px" }}
                >
                  secondary
                </Badge>
                <Badge
                  bg="dark"
                  style={{ fontFamily: "sans-serif", borderRadius: "0px" }}
                >
                  secondary
                </Badge>
              </Stack>
            </Card.Text>
            <Button
              variant="secondary"
              type="submit"
              style={{ fontFamily: "sans-serif" }}
            >
              Go to Answers
            </Button>
          </Card.Body>
        </Card>
      </div>
    </>
  );
}

export default ReadbyPatientId;
